/******* General I2C Read/Write API *******/
int i2c_read_reg(unsigned char reg_addr, unsigned int *reg_data)
{
    int ret = AW_FAIL;
    unsigned char cnt = 0;
    unsigned char buf[2] = { 0 };
    uint16_t data = 0;

    while (cnt < 5) {
        ret = i2c_read_bytes(I2C_ADDR, reg_addr, buf, 2);
        if (ret < 0) {
            aw_printf("i2c_read cnt=%d error=%d", cnt, ret);
        } else {
                    data = (uint16_t)(buf[0] & 0x00ff);
                    data <<= 8;
                    data |= (uint16_t)(buf[1] & 0x00ff);
                    *reg_data = data;
            break;
        }
        cnt++;
    }

    return ret;
}

int i2c_write_reg(unsigned char reg_addr, unsigned int reg_data)
{
    int ret = AW_FAIL;
    unsigned char cnt = 0;
    unsigned char buf[2];

    buf[0] = (reg_data&0xff00)>>8;
    buf[1] = (reg_data&0x00ff)>>0;

    while (cnt < 5) {
        ret = i2c_write_bytes(I2C_ADDR, reg_addr, buf, 2);
        if (ret < 0) {
            aw_printf("i2c_write cnt=%d error=%d", cnt, ret);
        } else {
            break;
        }
        cnt++;
    }

    return ret;
}

#define AW_DSP_I2C_WRITES
#define AW_MAX_RAM_WRITE_BYTE_SIZE        (128)
static void aw_dsp_writes(unsigned int dsp_madd_reg, unsigned int dsp_mdat_reg,
            const unsigned char *data, unsigned int len, uint16_t base)
{
    int i = 0;
#ifdef AW_DSP_I2C_WRITES
    uint32_t tmp_len = 0;
    uint32_t data_len = 0;
#else
    uint16_t reg_val = 0;
#endif

#ifdef AW_DSP_I2C_WRITES
    /* i2c writes */
    i2c_write_reg(dsp_madd_reg, base);

    for (i = 0; i < len; i += AW_MAX_RAM_WRITE_BYTE_SIZE) {
        data_len = (uint32_t)(len - i);
        if (data_len < AW_MAX_RAM_WRITE_BYTE_SIZE)
            tmp_len = data_len;
        else
            tmp_len = AW_MAX_RAM_WRITE_BYTE_SIZE;
        i2c_write_bytes(I2C_ADDR, dsp_mdat_reg, (unsigned char *)&data[i], tmp_len);
        k_sleep(1);
    }
#else
    /* i2c write */
    i2c_write_reg(dsp_madd_reg, base);
    for (i = 0; i < len; i += 2) {
        reg_val = (data[i] << 8) + data[i + 1];
        i2c_write_reg(dsp_mdat_reg, reg_val);
    }
#endif
}

/* General I2C Write bits API */
static int i2c_write_bits(unsigned char reg_addr, unsigned int mask, unsigned int reg_data)
{
    int ret = -1;
    unsigned int reg_val = 0;
    ret = i2c_read_reg(reg_addr, &reg_val);
    if (ret < 0) {
        return ret;
    }
    reg_val &= mask;
    reg_val |= reg_data;
    ret = i2c_write_reg(reg_addr, reg_val);
    if (ret < 0) {
        return ret;
    }
    return AW_OK;
}
