void  amp_aw85xxx_read_buf(void)
{
    int i, j, ret;
    unsigned int reg_val = 0;


    printf("[%s:%d] start: \n", __func__, __LINE__);

    for(j=0; j<7; j++)
    {
        for(i=0; i<10; i++)
        {
                
            ret = i2c_read_reg(i+(j*10), &reg_val);

            printf("0x%04x ", reg_val);
        }
        printf("\n");
    }
    printf("[%s:%d] END \n", __func__, __LINE__);

}


static void aw_reg_update(const struct reg_tab *tab, unsigned int array_cnt)
{
    int i = 0;

    for (i = 0; i < array_cnt; i++) {
        if (tab[i].addr == 0x05) {
            g_init_vol = tab[i].data & 0x03ff;
            aw_printf("init vol: %x", g_init_vol);
        } else if (tab[i].addr == 0x04){
			if (tab[i].data & (0x01<<2)) {
                g_is_dsp_bypas = 1;
            }
            i2c_write_reg(tab[i].addr, tab[i].data | (0x0007<<0)); /* default power down */
            continue;
        } else if (tab[i].addr == 0x63) {
			i2c_write_reg(tab[i].addr, tab[i].data & (~(0x1<<3)));
			continue;
		} else if (tab[i].addr == 0x67) {
			i2c_write_reg(tab[i].addr, tab[i].data | (0x1<<6));
			continue;
		}
        i2c_write_reg(tab[i].addr, tab[i].data);
        k_sleep(1);
    }
}


#define DSPMADD_REG        (0x40)
#define DSPMDAT_REG        (0x41)
#define DSP_CFG_ADDR    (0x9000)
#define DSP_FW_ADDR        (0x9A00)
void aw_dsp_update()
{    i2c_write_bits(0x4, ~(0x01<<0), 0x0<<0);
    /* dsp bypass */
    i2c_write_bits(0x4, ~(0x01<<2), 0x1<<2);

    /* aw_dev_memclk_select(aw_dev, AW_DEV_MEMCLK_OSC); */
    i2c_write_bits(0x15, ~(0x01<<3), 0x0<<3);

    /* update dsp fw */
    aw_dsp_writes(DSPMADD_REG, DSPMDAT_REG, &aw85xxx_dsp_fw[0], sizeof(aw85xxx_dsp_fw), DSP_FW_ADDR);

    /* update dsp fw cfg */
    aw_dsp_writes(DSPMADD_REG, DSPMDAT_REG, &aw85xxx_dsp_cfg[0], sizeof(aw85xxx_dsp_cfg), DSP_CFG_ADDR);

    /* OSC select PLL */
    i2c_write_bits(0x15, ~(0x01<<3), 0x1<<3);
}

static int amp_aw85xxx_enable_flag = 0;
static os_mutex amp_aw85xxx_mutex;
static os_mutex *amp_aw85xxx_mutex_ptr = NULL;

int _aw85xxx_pa_stop(void)
{
    /* mute all channel*/
    i2c_write_bits(0x4, ~(0x03<<7), 0x3<<7);

    /* dsp bypass */
    i2c_write_bits(0x4, ~(0x01<<2), 0x1<<2);

	i2c_write_bits(0x63, ~(0x01<<3), 0x0<<3);
	i2c_write_bits(0x67, ~(0x01<<6), 0x1<<6);

    /* amp power down */
    i2c_write_bits(0x4, ~(0x01<<1), 0x1<<1);

    /* power down */
    i2c_write_bits(0x4, ~(0x01<<0), 0x1<<0);

    aw_printf("done");

    return AW_OK;
}

/*Extern API: aw_init*/
void aw85xxx_init()
{
   
	if(amp_aw85xxx_mutex_ptr == NULL){
		amp_aw85xxx_mutex_ptr = &amp_aw85xxx_mutex;
		os_mutex_init(amp_aw85xxx_mutex_ptr);
	}
	os_mutex_lock(amp_aw85xxx_mutex_ptr, OS_FOREVER);

	if(amp_aw85xxx_enable_flag == 1){
		printk("have enable amp_aw85xxx_enable_flag == 1\n");
		goto _exit;
	}    
    /*step1:hardware reset*/
    aw_hw_reset();

    /*delay 5ms*/
    MS_DELAY(5);

    /* soft rest */
    i2c_write_reg(0x00, 0x55aa);
    /*delay 5ms*/
    MS_DELAY(5);

    /*step2:configuration register*/
    aw_reg_update(&init_register_tab[0], sizeof(init_register_tab)/sizeof(struct reg_tab));

    aw_dsp_update();
    _aw85xxx_pa_stop();
    aw_printf("done");

    MS_DELAY(5);
    aw85xxx_pa_start();
    amp_aw85xxx_enable_flag = 1;
    printk("[%s,%d] ----end !!!\n", __FUNCTION__, __LINE__);

    amp_aw85xxx_read_buf();

_exit:
    os_mutex_unlock(amp_aw85xxx_mutex_ptr);
    printk("[%s,%d] ----exit !!!\n", __FUNCTION__, __LINE__);
    return;

}

/******* Extern API: aw_pa_stop() *******/
int aw85xxx_pa_stop(void)
{
    struct device *gpio_dev = NULL;
  
	if(amp_aw85xxx_mutex_ptr == NULL){
		amp_aw85xxx_mutex_ptr = &amp_aw85xxx_mutex;
		os_mutex_init(amp_aw85xxx_mutex_ptr);
	}
	os_mutex_lock(amp_aw85xxx_mutex_ptr, OS_FOREVER);

    /* mute all channel*/
    i2c_write_bits(0x4, ~(0x03<<7), 0x3<<7);

    /* dsp bypass */
    i2c_write_bits(0x4, ~(0x01<<2), 0x1<<2);

	i2c_write_bits(0x63, ~(0x01<<3), 0x0<<3);
	i2c_write_bits(0x67, ~(0x01<<6), 0x1<<6);

    /* amp power down */
    i2c_write_bits(0x4, ~(0x01<<1), 0x1<<1);

    /* power down */
    i2c_write_bits(0x4, ~(0x01<<0), 0x1<<0);

	k_sleep(5);
	gpio_dev = device_get_binding(CONFIG_GPIO_ACTS_DEV_NAME);
	if (!gpio_dev) 
	{
		printk("[%s,%d] gpio_dev not found\n", __FUNCTION__, __LINE__);
		goto _exit;
	}

	gpio_pin_configure(gpio_dev, PIN_BOOST_EN, GPIO_DIR_OUT | GPIO_POL_NORMAL);
    gpio_pin_configure(gpio_dev, PIN_AMP_PDN, GPIO_DIR_OUT | GPIO_POL_NORMAL);  
    gpio_pin_configure(gpio_dev, AMP_AVDD_PW_ON, GPIO_DIR_OUT | GPIO_POL_NORMAL);
    

	gpio_pin_write(gpio_dev, PIN_AMP_PDN, 0);
    k_busy_wait(100);
    gpio_pin_write(gpio_dev, AMP_AVDD_PW_ON, 0);	
    
    k_sleep(1);
	gpio_pin_write(gpio_dev, PIN_BOOST_EN, 0);

    amp_aw85xxx_enable_flag = 0;
    aw_printf("done");

_exit:
    os_mutex_unlock(amp_aw85xxx_mutex_ptr);
    printk("[%s,%d] ----exit !!!\n", __FUNCTION__, __LINE__);    
    return AW_OK;
}

/******* Extern API: aw_pa_start() *******/
int aw85xxx_pa_start(void)
{
    unsigned int reg_val = 0;

    /* power up */
    i2c_write_bits(0x4, ~(0x01<<0), 0x0<<0);

    /*delay 2ms*/
    MS_DELAY(2);

    /* amp power up */
    i2c_write_bits(0x4, ~(0x01<<1), 0x0<<1);

	i2c_write_bits(0x63, ~(0x01<<3), 0x1<<3);
	i2c_write_bits(0x67, ~(0x01<<6), 0x0<<6);

    /*delay 10ms*/
    MS_DELAY(10);

    /* dsp enable */
    if(!g_is_dsp_bypas)
    {
        i2c_write_bits(0x4, ~(0x01<<2), 0x0<<2);
    }

	/* clear ana fault */
	i2c_write_bits(0x67, ~(0x01<<3), 0x1<<3);
	MS_DELAY(2);
	i2c_write_bits(0x67, ~(0x01<<3), 0x0<<3);

    /* unmute all channel*/
    i2c_write_bits(0x4, ~(0x03<<7), 0x0<<7);

    /* clear int */
    i2c_read_reg(0x02, &reg_val);
    i2c_read_reg(0x02, &reg_val);
	aw_printf("chip int st 0x02 = %x", reg_val);

    /* read chip status */
    i2c_read_reg(0x01, &reg_val);

    aw_printf("done, chip st 0x01 = %x", reg_val);
    return AW_OK;
}

/******* Extern API: aw85xxx_volume_control(vol) *******/
int aw85xxx_volume_control(int vol)
{
    if (vol < 0 || vol > 1023) {
        aw_printf("Unavailable parameter");
        return AW_FAIL;
    }
	
    /* The value of vol cannot be smaller than the value of init */
    if (vol < g_init_vol) {
        aw_printf("vol is less than init val, ignore");
        return AW_FAIL;
    }

    i2c_write_bits(0x5, ~(0x03ff<<0), vol<<0);

    return AW_OK;
}


